body:
After updating to 1.9.0 the ort model does have those imports libraries now. And it can infer on both PC and on IOS devices. Thanks!

May I ask for another quick question - whether my coreml ep setting is correct below? Tried to turn `useCPUOnly` on and off but the inference speed doesn't change at all. Is this normal (doubt so)? Sorry to be off from the issue topic again. Really appreciate the help!

```swift
  env = try ORTEnv(loggingLevel: ORTLoggingLevel.verbose)
  let options = try ORTSessionOptions()
  let ep_options = ORTCoreMLExecutionProviderOptions()
  ep_options.useCPUOnly = true  // setting this flag to true or false doesn't influence speed at all
  try options.appendCoreMLExecutionProvider(with: ep_options)
  session = try ORTSession(env: env, modelPath: modelPath, sessionOptions: options)
```

Thank you for the insights @gwang-msft! I do understand that a partitioned graph can harm the performance and have no problem seeing that maybe using CoreML can be instead slower. Weird thing is that I tried 1) ORT CPU, 2) CoreML CPU only, 3) CoreML, and they all run at exact same inference time (1500ms +/- <10ms, a big hefty model). I am not sure whether I created the session and its ep correctly.

- The onnxruntime python library for conversion is the pre-built 1.9.0 version
- The onnxruntime ios library was compiled from source code with `--use_coreml` and `--minimal_build=extended`
- Shouldn't turning `coreml_options.useCPUOnly = true/false` make a difference? Maybe CoreML CPU is slower than CoreML EP, even though they are both slower than ORT CPU. This doesn't happen in my case.

Thank you for your patience. This will really help me a lot.

